import styled from 'styled-components';

export const Container = styled.div`

    }

`;


export const Imagem = styled.div`
    img{
        width: 100%;
        height: 100%;
        display: inline-block;
    }

    label{
    display: inline-block;
    width: 100%;
    font-family: 'Bebas Kai';
    font-style: normal;
